        <Link to="/li">list </Link>
        <Link to="/li/2">list2 </Link>
        {/* <Switch> */}
        <Route>
          <List />
          <BlogPost />
          {/* 返回前进 */}
          <Backbutton />
        </Route>
        {/* </Switch> */}
      </div>
    </Router>
  );
}
export default router;
